_8; // 汎用的な背景カラーとして使用（濃）\n$BACKGROUND_COLOR_5: $COLOR_CHIP_9; // 汎用的な背景カラーとして使用（淡）\n\n\n// border-colorプロパティ\n// ---------------------------------------------\n\n$BORDER_COLOR: $COLOR_CHIP_5; // 汎用的な罫線カラーとして使用\n\n\n// BORDER_RADIUSプロパティ\n// ---------------------------------------------\n\n// $BORDER_RADIUS: 4px;\n\n\n// font-familyプロパティ\n// ---------------------------------------------\n\n// ゴシック系（和文）\n$FONT_FAMILY_SANS_JPN:\n    NotoSansJP,\n    '游ゴシック体',\n    'Yu Gothic',\n    YuGothic,\n    'ヒラギノ角ゴ Pro',\n    'Hiragino Kaku Gothic Pro',\n    'メイリオ',\n    Meiryo,\n    sans-serif;\n\n// 明朝系（和文）\n$FONT_FAMILY_SERIF_JPN:\n    '游明朝体',\n    'Yu Mincho',\n    YuMincho,\n    'ヒラギノ明朝 Pro',\n    'Hiragino Mincho Pro',\n    sans-serif;\n\n$FONT_FAMILY: $FONT_FAMILY_SANS_JPN;\n\n\n// font-sizeプロパティ\n// ---------------------------------------------\n\n// ブレークポイント未満\n$FONT_SIZE_NARROW: 16;\n\n// ブレークポイント以上\n$FONT_SIZE_WIDE: 20;\n\n\n// font-sizeプロパティ（注釈モジュール）\n// ---------------------------------------------\n\n// ブレークポイント未満\n$FONT_SIZE_NOTE_NARROW: 14;\n\n// ブレークポイント以上\n$FONT_SIZE_NOTE_WIDE: 14;\n\n\n// line-heightプロパティ\n// ---------------------------------------------\n\n// ブレークポイント未満\n$LINE_HEIGHT_NARROW: 1.75;\n\n// ブレークポイント以上\n$LINE_HEIGHT_WIDE: 1.75;\n\n\n// colorプロパティ\n// ---------------------------------------------\n\n$COLOR: #333;\n\n\n// opacityプロパティ\n// ---------------------------------------------\n\n$OPACITY: .5;\n\n\n// box-shadowプロパティ\n// ---------------------------------------------\n\n$BOX_SHADOW: 0 5px 6px rgba(125, 125, 125, .2);\n\n\n// background-image プロパティ（linear-gradient）\n// ---------------------------------------------\n\n// $LINER_GRADIENT: linear-gradient($SECONDARY_COLOR_2, $PRIMARY_COLOR);\n// $LINER_GRADIENT_2: linear-gradient(to right, $SECONDARY_COLOR_2, $PRIMARY_COLOR);\n\n\n// transitionプロパティ\n// ---------------------------------------------\n\n$TRANSITION_DURATION: .5s; // 汎用的に使用\n$TRANSITION_TIMING_FUNCTION: cubic-bezier(.25, .8, .25, 1); 